Enable or disable loading multipage sheets.
/// Microsoft Office Excel Workbook|XLS file formattrue to load multipage worksheets; false to load single page Use the paper dimensions obtained from the user to draw the worksheets. If the sheet dimension is larger than the paper dimensions obtained from user then the sheet will be divided to multiple pages. Each page will have the same dimensions obtained from the user (the sheet will be rendered as multiple sheets). If the sheet size is less than the page dimensions obtained from user then it will be drawn on a single page.
Refer to example.
